import React from 'react';
import Particles from "react-particles-js";
import logo from "../images/logo.png";


function About() {
    return (
        <>
            <Particles
                params={{
                    particles: {
                        number: {
                            value: 50,
                            density: {
                                enable: true,
                                value_area: 1000
                            }
                        },
                        shape: {
                            type: "circle",
                            stroke: {
                                width: 6,
                                color: "#ffffff"
                            }
                        },
                        color: {
                            value: "#000000"
                        },
                        lineLinked
                    }
                }}
            />





            <div className="about-container">
                About page
            </div>
        </>
    )
}

export default About;
